import React, { useState }  from "react";
import "../styles/navbar.css";
import logo from "../resource/logo.png";
//import { Link } from 'react-router-dom';

const  Navbar = ()=>{
        const [childTwo,setChildTwo]=useState({display:"block"});
        const changeButton=()=>{
            setChildTwo({display:"none"})
        }
        return(
        <div className="navbar">
            <img src={logo} />
            <div onClick={changeButton} className="menuButton">
                <div style={{childTwo}}></div>
                <div></div>
                <div></div>
            </div>
            <div className="menu">
        <nav>
            <a href="#">HOME</a>
            <a href="#">ABOUT</a>
            <a href="#">TEAM</a>
            <a href="#">SERVICES</a>
            <a href="#">WORK</a>
            <a href="#">CLIENTS</a>
            <a href="#">CONTACT</a>
        </nav>
            </div>
        </div>
    )
}
export default Navbar
